import React from 'react';
import { Link } from 'react-router-dom';
import {
    SideNav,
    SideNavItems,
    SideNavLink
  } from 'carbon-components-react';

export default class Sidebar extends React.Component {
    constructor(props) {
        super(props)
    }

    render () {
        return <SideNav
                isFixedNav
                expanded={true}
                isChildOfHeader={false}
                aria-label="Side navigation">
                <SideNavItems>
                <SideNavLink renderIcon={Fade16} href="/">
                    Overview
                </SideNavLink>
                <SideNavLink renderIcon={Fade16} href="/engagement">
                    Engagement
                </SideNavLink>
                </SideNavItems>
            </SideNav>
    }
}
